void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.x;
    float f = 150.0;
    float u = uv.y-0.25;
    uv.y*=.6;
    float t = iTime * .05+199.0;
    float e = 0.123 * sin(uv.y*9.0);
    float i = cos(uv.x*.1)*1.323;
    uv.x -= t + sin(uv.y * i) * e * 2.7;
     uv.y += t - cos(floor(sin(uv.x*.1)*120.0)*3.3 * i) * e;
    float g = .1 * floor(uv.x*5.0);
    float k = sin(uv.x * g) * tan(uv.y*g) * f;
    fragColor = vec4(k);
}
